export const darkTheme = {
    bg:"#08515e", // below about
    bgLight: "#214a38",
    primary:"#7a5905", //name down
    text_primary: "#ffffff",
    text_head: "#ffffff",
    text_secondary: "#ffffff",
    text_belowHead: "#291e02",
    card:"#103e45",
    card_light: '#022a30', //about
    button:"",
    white:"#FFFFFF",
    black:"#000000",
}

export const lightTheme = {
    bg:"#FFFFFF",
    bgLight: "#f0f0f0",
    primary:"#be1adb",
    text_primary:"#111111",
    text_secondary:"#48494a",
    card:"#FFFFFF",
    button:"#5c5b5b",
}
